import React from 'react';
import scrumate from './../image/scrumate.png';
import { Box, Card, CardActionArea, CardMedia, CardContent, CardActions, Icon } from '@material-ui/core';

export default class Apps extends React.Component {

  render() {
    return (
        <Box color="#263238" width={2/5} align="center">
          <CardActionArea>
            <CardMedia
              image={scrumate}
            />
          </CardActionArea>
          <CardActions>
            <Icon className="apple" />
          </CardActions>
        </Box>
    );
  }
}
